import React from 'react';
import Typography from '@material-ui/core/Typography';
import Box from '@material-ui/core/Box';
import Button from '@material-ui/core/Button';
import Popover from '@material-ui/core/Popover';
import PopupState, { bindTrigger, bindPopover } from 'material-ui-popup-state';

export default function Historical(props) {

    const data=props.data
    console.log("Data",data)
    
  return (
    <PopupState variant="popover" popupId="demo-popup-popover">
      {(popupState) => (
        <div>
          <Button variant="contained" color="primary" {...bindTrigger(popupState)}>
            Historical Predictions
          </Button>
          <Popover
            {...bindPopover(popupState)}
            anchorOrigin={{
              vertical: 'bottom',
              horizontal: 'center',
            }}
            transformOrigin={{
              vertical: 'top',
              horizontal: 'center',
            }}
          >
            <Box p={2}  style={{width:"500px"}}>
              
              <Typography  style={{backgroundColor:`${data[0].color}`,paddingTop:10,paddingBottom:10,paddingLeft:20,paddingRight:20,margin:'1px'}}><b>{data[0].date}: {data[0].condit}</b></Typography>
              <Typography style={{backgroundColor:`${data[1].color}`,paddingTop:10,paddingBottom:10,paddingLeft:20,paddingRight:20}}><b>{data[1].date}: {data[1].condit}</b></Typography>
              <Typography style={{backgroundColor:`${data[2].color}`,paddingTop:10,paddingBottom:10,paddingLeft:20,paddingRight:20}}><b>{data[2].date}: {data[2].condit}</b></Typography>
              <Typography style={{backgroundColor:`${data[3].color}`,paddingTop:10,paddingBottom:10,paddingLeft:20,paddingRight:20}}><b>{data[3].date}: {data[3].condit}</b></Typography>
              <Typography style={{backgroundColor:`${data[4].color}`,paddingTop:10,paddingBottom:10,paddingLeft:20,paddingRight:20}}><b>{data[4].date}: {data[4].condit}</b></Typography>
              <Typography style={{backgroundColor:`${data[5].color}`,paddingTop:10,paddingBottom:10,paddingLeft:20,paddingRight:20}}><b>{data[5].date}: {data[5].condit}</b></Typography>
              <Typography style={{backgroundColor:`${data[6].color}`,paddingTop:10,paddingBottom:10,paddingLeft:20,paddingRight:20}}><b>{data[6].date}: {data[6].condit}</b></Typography>
              <Typography style={{backgroundColor:`${data[7].color}`,paddingTop:10,paddingBottom:10,paddingLeft:20,paddingRight:20}}><b>{data[7].date}: {data[7].condit}</b></Typography>
              <Typography style={{backgroundColor:`${data[8].color}`,paddingTop:10,paddingBottom:10,paddingLeft:20,paddingRight:20}}><b>{data[8].date}: {data[8].condit}</b></Typography>
              <Typography style={{backgroundColor:`${data[9].color}`,paddingTop:10,paddingBottom:10,paddingLeft:20,paddingRight:20}}><b>{data[9].date}: {data[9].condit}</b></Typography>

              <Typography style={{backgroundColor:`${data[10].color}`,paddingTop:10,paddingBottom:10,paddingLeft:20,paddingRight:20}}><b>{data[10].date}: {data[10].condit}</b></Typography>
              <Typography style={{backgroundColor:`${data[11].color}`,paddingTop:10,paddingBottom:10,paddingLeft:20,paddingRight:20}}><b>{data[11].date}: {data[11].condit}</b></Typography>
              <Typography style={{backgroundColor:`${data[12].color}`,paddingTop:10,paddingBottom:10,paddingLeft:20,paddingRight:20}}><b>{data[12].date}: {data[12].condit}</b></Typography>
              <Typography style={{backgroundColor:`${data[13].color}`,paddingTop:10,paddingBottom:10,paddingLeft:20,paddingRight:20}}><b>{data[13].date}: {data[13].condit}</b></Typography>
              <Typography style={{backgroundColor:`${data[14].color}`,paddingTop:10,paddingBottom:10,paddingLeft:20,paddingRight:20}}><b>{data[14].date}: {data[14].condit}</b></Typography>
              <Typography style={{backgroundColor:`${data[15].color}`,paddingTop:10,paddingBottom:10,paddingLeft:20,paddingRight:20}}><b>{data[15].date}: {data[15].condit}</b></Typography>
              <Typography style={{backgroundColor:`${data[16].color}`,paddingTop:10,paddingBottom:10,paddingLeft:20,paddingRight:20}}><b>{data[16].date}: {data[16].condit}</b></Typography>
              <Typography style={{backgroundColor:`${data[17].color}`,paddingTop:10,paddingBottom:10,paddingLeft:20,paddingRight:20}}><b>{data[17].date}: {data[17].condit}</b></Typography>
              <Typography style={{backgroundColor:`${data[18].color}`,paddingTop:10,paddingBottom:10,paddingLeft:20,paddingRight:20}}><b>{data[18].date}: {data[18].condit}</b></Typography>

              <Typography style={{backgroundColor:`${data[19].color}`,paddingTop:10,paddingBottom:10,paddingLeft:20,paddingRight:20}}><b>{data[19].date}: {data[19].condit}</b></Typography>
              <Typography style={{backgroundColor:`${data[20].color}`,paddingTop:10,paddingBottom:10,paddingLeft:20,paddingRight:20}}><b>{data[20].date}: {data[20].condit}</b></Typography>
            
            </Box>
          </Popover>
        </div>
      )}
    </PopupState>
  );
}
